  fetch('http://127.0.0.1:8000/auth_api/token',{
    method: 'POST',
    headers: {
        'Content-Type': 'application/json;charset=utf-8'
    },
    body: '{"username": "admin", "password": "admin" }'
})
.then(res => res.json())
.then(data => console.log(data))
